import React, { Children } from "react";
import { Route, Redirect } from "react-router-dom";

export const ProtectedRoute = ({ childern, ...restProps }) => {
  let token = localStorage.getItem("token");
  console.log(token);
  return (
    <Route
      {...restProps}
      render={() => {
        if (token === null) {
          return <Redirect to="/login" />;
        } else {
          return childern;
        }
      }}
    />
  );
};
